import React, { Component } from 'react';
import {db} from "firebase";

class LandingPage extends Component {
  getData  = () => {
    db.ref('playlist').on("value", data => console.log(data))
  }
  render() {
    return (
      <div className="container-fluid">
        {this.getData()}
      </div>
    );
  }
}

export default LandingPage;
